      SELECT DISTINCT col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT + ( col1 ) * + 53 + - 43 * + col2 BETWEEN - col1 * - - col2 * - col2 AND + 4;
  - name: tab2

outputs:
  - name: q13756.out
    data: |
      23
      40
      58
